('PRE60dde83130c3f', 90, 'Fono Remington', '  Il Phon ha un potenza di 2300 W ed i 130 km/h dichiarato dalla casa  molto verosimile in quanto alla massima velocit il getto di aria  veramente potente e permette di asciugare molto rapidamente i capelli, inoltre grazie al generatore di ioni ci assicura capelli lucenti ed evita che diventino c', 69, 'Remington', 'I60dde83130164'),
('PRE60dde86339ca3', 40, 'Set Asciugamani da Bagno', '  Set asciugamani bagno bianchi firmati Caleffi, con telo doccia e asciugamano ospite. 100% cotone.', 39, 'Caleffi', 'I60dde8633848b'),
('PRE60dde89ccab72', 80, 'Piastra Imetec Bellissima', '  Le piastre Imetec sono progettate per assicurare il meglio a qualsiasi chioma, mantenendo i capelli nutriti e idratati durante lo styling, proprio per questo le lastre sono rivestite di materiali altamente resistenti, come la ceramica tormalina e il titanio che assicurano la massima protezione del', 30, 'Imetec', 'I60dde89cca7bf'),
('PRE60dde8bb4129b', 35, 'Puzzle Ravensburger Mappamondo', '  Puzzle Ravensburger Mappamondo 1500 pezzi.', 39, 'Ravensburger', 'I60dde8bb40d01'),
('PRE60dde8e797242', 38, 'Rasoio Elettrico Braun', '  Il rasoio da barba elettrico Braun Series 5 offre una rasatura efficace ad ogni passata anche nelle aree pi difficili da raggiungere. Dotato di batteria Li-Ion, si ricarica in 1 ora per 50 min di rasatura senza fili ed  utilizzabile anche sotto carica.', 60, 'Braun', 'I60dde8e794405'),
('PRE60dde9589875a', 60, 'Set Coltelli da Cucina', ' Set di coltelli Yabano, lame forgiate di alta qualit, realizzate in acciaio inossidabile tedesco, W-Nr. 1.4116. Contiene dallo 0,45 allo 0,55% di carbonio, dal 14 al 15% di cromo, dallo 0,5 allo 0,8% di molibdeno e dallo 0,1 allo 0,2% di vanadio. Lo scopo della lega di molibdeno  aumentare la res', 22, 'Yabana', 'I60dde95895bf0'),
('PRE60dde98a73b47', 42, 'Batteria di Pentole Stone&Wood', '  Alluminio Grigio. La batteria 8 pezzi della linea Stone&Wood ha un corpo in alluminio forgiato, un fondo ad alto spessore e un rivestimento interno antiaderente rinforzato a 4 strati. La batteria Stone&Wood  adatta a tutti i piani cottura, compresa l\'induzione. Adatta al lavaggio in lavastoviglie', 39, 'Tognana', 'I60dde98a71221');

