INSERT INTO `prodotto` (`id`, `nome`, `descrizione`, `tipologia`, `quantita`, `marca`, `prezzo`, `idImmagine`) VALUES
('PRO60ddd17b77ac3', 'Caff Lavazza', ' Lavazza Qualit Rossa incarna tutta la passione di Lavazza per il caff. Una miscela dall\'aroma unico e dal corpo pieno, ricco di straordinaria rotondit, composta prevalentemente da Arabica brasiliani e Robusta africani.', 'Bevande', 50, 'Lavazza', 1.2, 'I60ddd17b766b0'),
('PRO60ddd23b09f0c', 'Ammorbidente Coccolino ', ' L\'ammorbidente Coccolino Concentrato (aria di primavera, 4 l) si prende cura dei tuoi capi rispettando di pi l\'ambiente che ti circonda. Coccolino Concentrato 750 ml rispetto a Coccolino Diluito 2 lt, per ogni lavaggio, contiene il 70% in meno di acqua, riparmia il 57% di plastica e utilizza meno ', 'Cura della casa', 40, 'Coccolino', 3.2, 'I60ddd23b09828'),
('PRO60ddd33b70869', 'Coca-Cola zero', ' La confezione contiene 6 bottiglie da 1.5l.\r\nIngredienti: acqua, anidride carbonica, colorante E 150d, edulcoranti, ciclammato di sodio, acesulfame K e aspartame, acidificante acido fosforico, aromi naturali (inclusa caffeina), correttore di acidit citrato trisodico.\r\nContiene una fonte di fenilal', 'Bevande', 50, 'Coca-Cola', 2.99, 'I60ddd33b70186'),
('PRO60ddd41f047fb', 'Ananas Del Monte', ' Ananas Del Monte da sempre garanzia di qualit. Conservare in un luogo fresco ed asciutto. Svuotare il contenuto inutilizzato in un contenitore adeguato non metallico, coprire e conservare in frigorifero. Usare entro 3-4 giorni.', 'Frutta', 30, 'Del Monte Gold Anana', 1.15, 'I60ddd41f041ba'),
('PRO60ddd4e5c1a01', 'Lines Assorbenti Seta Ultra', 'Con Ali. \r\nIl nuovo Lines Seta Ultra ha lesclusiva tecnologia STRATI ATTIVI: il liquido filtra velocemente verso il basso, dal primo allultimo strato ad assorbenza potenziata, dove rimane bloccato lontano dalla pelle.\r\n\r\n', 'Cura della persona', 80, 'Lines', 4.28, 'I60ddd4e5c1397'),
('PRO60ddd5cbac883', 'Vino Rosso Chateau Margaux', ' Alla degustazione si presenta come un vino voluttuoso e generoso. Sui frutti rossi durante la loro giovinezza, l\'et apporta una grande complessit. Note di bois e torrefazione vanno ad aggiungersi al bouquet. Rotondi e golosi, si completano in un finale piacevolmente grasso.', 'Bevande', 10, 'Chateau Margaux', 600, 'I60ddd5cbab86a'),
('PRO60ddd6147d8a5', 'Cornetto Algida', ' Algida Cornetto Classico  un gelato alla panna, con una cialda di wafer, una copertura al cacao e della granella di nocciole e meringhe sulla cima. Algida Cornetto Classico  alto circa 15cm e la parte superiore circolare ha un diametro di 6cm. Delle dimensioni dell\'intero cono, la parte gelato  ', 'Gelati e surgelati', 80, 'Algida', 1.5, 'I60ddd6147d296'),
('PRO60ddd699702e2', 'Gelato Fondente Carte D\'Or', ' Gelato al cioccolato fondente con cioccolato al 70% di cacao dell\'ecuador', 'Gelati e surgelati', 68, 'Carte D\'Or', 2.1, 'I60ddd6996fc36'),
('PRO60ddd6fdb0958', 'Lamette Gilette Blue', ' Prodotti di bellezza di marca Gillette progettato per coccolarti, prenderti cura di te stesso e sentirti bello ogni giorno dell\'anno.\r\n\r\n', 'Cura della persona', 90, 'Gilette', 2.78, 'I60ddd6fdb05ab'),
('PRO60ddd7690194e', 'Latte Zymil Alta Digeribilit', ' Buono digeribile Zymil  il latte con l\'1% di grassi, a lunga conservazione, di Parmalat che permette anche a chi ha problemi di digestione del lattosio di godere della bont e delle propriet nutritive del latte.', 'Uova latte e lattici', 1, 'Parmalat', 0.8, 'I60ddd7690133f'),
('PRO60ddd7e1f3829', 'Macinato Tacchino', ' Macinato fine di tacchino pronto in 10 minuti. Gustoso e ideale per tutte le ricette.', 'Carne', 63, 'Amadori', 1.3, 'I60ddd7e1f3425'),
('PRO60ddd8c36cf28', 'Olio extravergine di oliva', ' Questo olio extravergine di oliva di prima qualit di prima qualit, con il puro odore di olive e un leggero aroma di erbe,  ottenuto dalle migliori variet di olive. Ha un colore dorato con una tonalit verdastra, gusto equilibrato e aroma armonico.', 'Verdura', 90, 'Farchioni', 11.6, 'I60ddd8c36c5d3'),
('PRO60ddd9292ce59', 'Pan Bauletto di Grano Duro', ' Il nostro Pan Bauletto al Grano Duro nasce dall\'unione della semola di grano duro con l\'olio extravergine d\'oliva che  lanima eccezionale di questo pane caratterizzato per il suo sapore pieno. La superficie dorata presenta una leggera sfarinatura di semola, che dona un tocco di rustica naturalit', 'Pane', 120, 'Mulino Bianco', 1.7, 'I60ddd9292c740'),
('PRO60ddda009f645', 'Pane di segale', ' Contiene: Grano/Frumento\r\nPu contenere tracce di frutta a guscio.', 'Pane', 1, 'Gilli', 1.29, 'I60ddda009edde'),
('PRO60ddda51d548a', 'Latte Parzialmente Scremato', ' Il latte Bont e Linea  il latte di Parmalat parzialmente scremato per nutrirsi ogni giorno con leggerezza.', 'Uova latte e lattici', 86, 'Parmalat', 0.7, 'I60ddda51d495f'),
('PRO60ddda92c4e25', 'Pesche sciroppate', ' Le pesche sciroppate Valfrutta sono confezionate subito dopo la raccolta e in questo modo viene mantenuto nello sciroppo tutto il sapore della frutta. Immerse in un dolce sciroppo, le pesche sciroppate Valfrutta sono gustosissime consumate al naturale, ma ideali anche in dolci fatti in casa.', 'Frutta', 66, 'Valfrutta', 3.75, 'I60ddda92c482b'),
('PRO60dddae858a78', 'Philadelphia Original', ' Latte pastorizzato, crema di latte, sale, addensanti: alginato di sodio  carragenina, fermenti lattici. Philadelphia  il nome commerciale di un formaggio spalmabile di tipo quark prodotto dalla Kraft Foods negli Stati Uniti d\'America e venduto in molti stati. In Italia  commercializzato dal 1971', 'Salumi e formaggi', 55, 'Philadelphia', 1, 'I60dddae8583ef'),
('PRO60dddb361077e', 'Vino Rosso di Montepulciano', ' Le caratteristiche del Rosso di Montepulciano sono quelle tipiche del Sangiovese, suo vitigno di base. L\'intensa colorazione, la complessit dei profumi con note olfattive fruttate di amarena e fragole, sensazioni floreali di viola e lievi sfumature minerali ed erbacee.', 'Bevande', 50, 'Carpineto', 6.2, 'I60dddb36101b6'),
('PRO60dddba613e93', 'Salsicce ', ' Salsicce Aia a punta di coltello, senza glutine.', 'Carne', 40, 'Aia', 2.7, 'I60dddba61385d'),
('PRO60dddc176eb5b', 'Sofficini Findus', ' Ripieno vibrante, gusto roboante! I Sofficini Findus Prosciutto Cotto Pi Mozzarella hanno pi ripieno e pi mozzarella: pi golosi che mai! Fatti venire l\'acquolina in bocca con il gusto del prosciutto cotto  pi un cuore di mozzarella filante! ', 'Gelati e surgelati', 110, 'Findus', 2, 'I60dddc176e425'),
('PRO60dddc4f1fc49', 'Vino Bianco Tavernello', ' Prodotto esclusivamente con uve raccolte in vitigni italiani di qualit e certificati lungo tutto la filiera, il vino bianco Tavernello in brik  un vino da pasto ideale per accompagnare primi piatti come la pastasciutta, ma anche risotti con il pesce, secondi con carni bianche o pesce fritto e anc', 'Bevande', 200, 'Tavernello', 0.99, 'I60dddc4f1f4b3'),
('PRO60dddcca07692', 'Vino Rosso Tavernello', ' Il buon vino della tradizione italiana.\r\n	Contiene solfiti.Contiene: Anidride solforosa / solfiti', 'Bevande', 200, 'Tavernello', 0.99, 'I60dddcca070b5'),
('PRO60dde17a4b4c3', 'Birra Peroni', ' La birra Peroni  una birra lager italiana prodotta dall\'omonimo birrificio a partire dal 1846. Dall\'ottobre 2016 fa parte del gruppo giapponese Asahi Breweries. Viene prodotta negli stabilimenti del gruppo situati a Roma, Padova e Bari, mentre il malto proviene dalla Malteria Saplo di Pomezia.', 'Bevande', 50, 'Peroni', 0.7, 'I60dde17a4ae92');

